import React from 'react';
import { useSelector } from "react-redux";


const TestPage = () => {

  const data = useSelector((state) => state.allUsersData.data);
  console.log("====", data)
  const renderList = data.map((user) =>{
    const { id, name, email, company, phone, website } = user;

    return (
      <div style={{marginLeft:'300px'}} key={id}>
        <h1>Fetchs api data</h1>
        <h2>{renderList.name}</h2>
      </div>
    );
  });

  return (
      <div>
          {renderList}
      </div>
  );
};

export default TestPage;
